class Solution:
    def isSubsequence(self, s, t):
        index = 0
        for c in t:
            if index >= len(s):
                break
            if c == s[index]:
                index += 1
        return index == len(s)


if __name__ == '__main__':
    solution = Solution()
    print(solution.isSubsequence("leeeeetcode",
                                 ""))
